import React from "react";
import DeleteIcon from "@material-ui/icons/Delete";

const Note = (props) => {
    function handleClick() {
        props.onDelete(props.id);
    }

    return (
        <div className="card bg-white border-light my-3">
            <div className="card-header fs-5 fw-bold">{props.title}</div>
            <div className="card-body">
                <p className="card-text fs-6">{props.content}</p>
            </div>
            <div className="card-footer p-0">
                <button className="bg-white" onClick={handleClick}><DeleteIcon /></button>
            </div>
        </div>    
    );
}

export default Note;
